import React, { useState } from 'react';
import Button from './Button';
import Counter from './Counter';

function ParentWrapper(){

    const [valeur, setValeur] = useState(0);

    function add(){
        setValeur(valeur + 1);
    }
    function sub(){
        setValeur(valeur - 1);
    }

    return (
        <div>
            <Counter valeur={valeur} />
            <Button styleclass="green" label="Ajouter" onClick={add}/>
            <Button styleclass="red" label="Retirer" onClick={sub}/>
        </div>
    );

}

export default ParentWrapper;
